13.14 L 170.05 156.59 L 137.4 100.04 L 170.05 156.59 L 235.35 156.59 L 268.12 213.14 L 235.35 269.68 L 268 326.23 L 235.35 382.78 L 170.05 382.78 L 137.4 326.23 L 170.05 269.68 L 235.35 269.68 \" />\r\n\r\n<path id=\"path1\" stroke-sasharray=\"0,0\" stroke-miterlimit=\"10\" d = \"M 366.07 495.88 L 333.42 552.43 L 268.12 552.43 L 235.35 608.98 L 170.05 608.98 L 137.42 552.43 L 170.07 495.88 L 137.42 439.33 L 72.12 439.33 L 39.47 495.88 L 72.12 552.43 L 137.42 552.43 L 170.07 495.88 L 235.35 495.88 L 268.12 552.43\" />\r\n\r\n</svg>\r\n</object>\r\n\r\n<p id=\"more\"></p>\r\n<img src=\"/sites/all/themes/icm/images/engage.png\" id=\"engage\" alt=\"Click to Engage with ICM\" title=\"Click to Engage with ICM\" />\r\n</div>\r\n\r\n<div id=\"spacer\"></div>\r\n\r\n<div class=\"seemore cf\">\r\n<p>Money Management is what we know…….but it isn’t who we are.  We are husbands, wives, fathers, sons, & daughters.  We are skiers, Crossfitters, cyclists, golfers & little league coaches.  We are chauffers, band aide applicators and jesters for the enjoyment of 3 year olds.  We understand that investments are more than just money; they are hopes, dreams, futures as well as pasts and presents.  We live life.  We understand.  </p>\r\n\r\n<p>In our spare time we’ve spent 236,700 hours, 9,862 full days(ok we may have slept) or 29,587 workdays(8 hour days) in pursuit of education.  We have 9 undergraduate degrees, 5 advanced degrees & 3 CFA Charterholders. </p>\r\n  \r\n<p>We are academics, we are quantitative researchers, we are economist.  Wed have navigated the best and worst of what markets have to offer.  We diligently seek to master our craft in the pursuit of a greater understanding of how capital markets function and the impact this has on life.  While we have tried our best, we haven’t put a man on the moon yet but are working on it.  We encourage you to take this uncommon journey with us.  </p>\r\n<h3>Scientific Investing. Bringing Life into Focus.</h3>\r\n\r\n<div id=\"c1conta