4 1331 M 70.5 1324.28 L 70.5 1309.28  \" />\r\n\r\n\r\n<path  style=\"stroke-linecap:round;stroke-linejoin:miter;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:6000;stroke-dashoffset:0\" data-550-top=\"stroke-dashoffset:6000;\" stroke-miterlimit=\"10\" data--1000-top=\"stroke-dashoffset:0;\" d = \"M 84 1335 L 100.5 1344 L 100.5 1398 L 55.5 1423 L 55.5 1442 L 39 1451 L 22.5 1442 L 22.5 1423 L 39 1414 L 55.5 1423 M 22.5 1423 L 6 1414 L -10.5 1423 L -10.5 1442 L 6 1451 L 22.5 1442 M 6 1451 L 6 1470 L -10 1479 L -26.5 1470 L -26.5 1451 L -10.5 1442\"/>\r\n\r\n<path  style=\"stroke-linecap:round;stroke-linejoin:miter;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:6000;stroke-dashoffset:0\" data-550top=\"stroke-dashoffset:6000;\" stroke-miterlimit=\"10\" data--1000-top=\"stroke-dashoffset:0;\" d = \"M 39 1417.73 L 52 1425 M 52 1440 L 39 1447 M 19 1440 L 6 1447 M 19 1425 L 6 1417.73 M 3 1468 L -10 1475\" />\r\n\r\n</svg>\r\n<section id=\"history\" class=\"cf\">\r\n\r\n<div class=\"sectionlimit\">\r\n<div class=\"text-left cf\">\r\n<h2>History</h2>\r\n<p>Created in 2009. ICM was built to bridge the divide between institutional advisors and everyday advisors. We offer an uncommon perspective to asset management. Uncommon in both its clearity and discipline. Our origin is as a “lift out” of the investment department form one of the nations largest mutual insurance companies. </p>\r\n<p>Our investment process was used to manage one of the nation’s largest pension departments.</p>\r\n</div>\r\n<div class=\"text-right blank\"></div>\r\n<hr />\r\n\r\n\r\n\r\n\r\n\r\n<div class=\"text-left blank\"></div>\r\n\r\n<div class=\"text-right cf\">\r\n<h2>Expertise</h2>\r\n<p>The collective experience of our principals spans more than 70 years. As an investment team with our roots in quantitative research, each investment decision is made with strict care and precise calculation. We do not invest on hunches and more importantly we make investment decisions not business decisions masked as investment decisions. </p>\r\n</div>\r\n<hr />\r\n<hr />\r\n\r\n</div>\r\n\r\n\r\n\r\n\r\n</section>\r\n<section id=\"philosophy\">\r\n<div class=\"sectionlimit\">\r\n\r\n<iframe src=\"http://fast.wistia.net/embed/iframe/zokauap588?videoFoam=true\" allowtransparency=\"true\" frameborder=\"0\" scrolling=\"no\" class=\"wistia_embed\" name=\"wistia_embed\" allowfullscreen mozallowfullscreen webkitallowfullscreen oallowfullscreen msallowfullscreen width=\"788\" height=\"442\"></iframe>\r\n\r\n<img src=\"hexelements.png\" alt=\"equations\" data--120-bottom=\"padding-top:0px;\" data--1000-bottom=\"padding-top:200px;\" style=\"padding-top:100px\"  />\r\n\r\n</div>\r\n</section>\r\n\r\n\r\n<section id=\"data\">\r\n<div class=\"sectionlimit\">\r\n\r\n<h2>MARKET EFFICIENCY</h2>\r\n<img src=\"percentvalue.png\" alt=\"PRESENT VALUE OF DIVIDENDS VS. ACTUAL STOCK PRICE\"/>\r\n\r\n<h2>Do Valuations Matter</h2>\r\n<img src=\"percentvalue.png\" alt=\"S & P 500 10 year rolling returns\"/>\r\n</div>\r\n\r\n<img src=\"sciencetoy.jpg\" alt=\"science toy\"  style=\"float:left; max-width:70%; padding:10% 0;\"/>\r\n<div class=\"sectionlimit\">\r\n\r\n<div class=\"slideout\">\r\n<img src=\"2.png\" class=\"slideicon\" />\r\n    <div class=\"grayspace\">\r\n        <h3>Long Term Capital Markets Expectation</h3>\r\n        <p>Historical estimates of risk and return.</p>\r\n            <img src=\"5.png\" />\r\n\r\n    </div>\r\n</div>\r\n\r\n<div class=\"slideout\">\r\n<img src=\"1.png\" class=\"slideicon\" />\r\n    <div class=\"grayspace\">\r\n    <h3>Long Term Valuation Analysis</h3>\r\n    <p>Quantify the return opportunity from various valuation levels.</p>\r\n        <img src=\"6.png\" />\r\n\r\n    </div>\r\n</div>\r\n<div class=\"slideout\">\r\n<img src=\"3.png\" class=\"slideicon\" />\r\n    <div class=\"grayspace\">\r\n    <h3>Current Valuation Analysis</h3>\r\n    <p>Measure and Quantify fair value as well as depersion from fair value while being mindful of paradigm shifts.</p>    <img src=\"7.png\" />\r\n\r\n    </div>\r\n</div>\r\n<div class=\"slideout\">\r\n<img src=\"4.png\" class=\"slideicon\" />\r\n    <div class=\"grayspace\">\r\n    <h3>Tactical Decision</h3>\r\n    <p>Over or underweight decision as well as product selection implemented in a series of meaningful steps building into a position as valuations become more compelling.</p>\r\n    <img src=\"8.png\" />\r\n    </div>\r\n</div>\r\n\r\n</div>\r\n</section>\r\n\r\n<section id=\"getstarted\">\r\n\r\n<a href=\"/contact\">GET STARTED WITH US</a>\r\n\r\n</section>\r\n\r\n\r\n\r\n\r\n</div>\r\n\r\n  <script type=\"text/javascript\">\r\nskrollr.init({forceHeight: false});\r\n\r\n</script>','','full_html');
