INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`)
VALUES
	(1,'node',' integrated capital management we bring life into focus money management is what we know but it isn t who we are we are husbands wives fathers sons daughters we are skiers crossfitters cyclists golfers little league coaches we are chauffers band aide applicators and jesters for the enjoyment of 3 year olds we understand that investments are more than just money they are hopes dreams futures as well as pasts and presents we live life we understand in our spare time we ve spent 236700 hours 9862 full days ok we may have slept or 29587 workdays 8 hour days in pursuit of education we have 9 undergraduate degrees 5 advanced degrees 3 cfa charterholders we are academics we are quantitative researchers we are economist wed have navigated the best and worst of what markets have to offer we diligently seek to master our craft in the pursuit of a greater understanding of how capital markets function and the impact this has on life while we have tried our best we haven t put a man on the moon yet but are working on it we encourage you to take this uncommon journey with us scientific investing bringing life into focus what it looks like to workw ith icm what it feels like to workw ith icm  skrollrinit forceheight false jquery more click function settimeout function skrollrinit forceheight false 1000  ',0),
	(2,'node',' left brian history created in 2009 icm was built to bridge the divide between institutional advisors and everyday advisors we offer an uncommon perspective to asset management uncommon in both its clearity and discipline our origin is as a lift out of the investment department form one of the nations largest mutual insurance companies our investment process was used to manage one of the nation s largest pension departments expertise the collective experience of our principals spans more than 70 years as an investment team with our roots in quantitative research each investment decision is made with strict care and precise calculation we do not invest on hunches and more importantly we make investment decisions not business decisions masked as investment decisions market efficiency do valuations matter long term capital markets expectation historical estimates of risk and return long term valuation analysis quantify the return opportunity from various valuation levels current valuation analysis measure and quantify fair value as well as depersion from fair value while being mindful of paradigm shifts tactical decision over or underweight decision as well as product selection implemented in a series of meaningful steps building into a position as valuations become more compelling get started with us ',0);
